import './App.css';
import React, {useEffect, useState} from 'react';


function App() {

  const [str,setStr] = useState('');

  function buildStr(e){
    let newStr = str + e;
    setStr(newStr);
  }

  return (
    <div className="App">
      <div className="forerunner">

          <p className = "forerunnerText" onClick={()=>{buildStr('A')}}>A</p>
          <p className = "forerunnerText" onClick={()=>{buildStr('B')}}>B</p>
          <p className = "forerunnerText" onClick={()=>{buildStr('C')}}>C</p>
          <p className = "forerunnerText" onClick={()=>{buildStr('D')}}>D</p>
          <p className = "forerunnerText" onClick={()=>{buildStr('E')}}>E</p>
          <p className = "forerunnerText" onClick={()=>{buildStr('F')}}>F</p>
          <h1>{str}</h1>

      </div>
      <footer>Made by Cristian Reyes</footer>
    </div>
  );
}

export default App;
